        <script type="text/ng-template" id="DocumentsViewNewUI.html">

<div class="{{::dc.constants.HeaderCssClass}} newUI">
    <div class="{{::dc.constants.HeaderBackgroundClass}} searchBoxContainer">
        <ng-Font-icon class="searchIconBackClean new" ng-if="dc.hasSearchKeyword || dc.showObjectsView" ng-click="dc.onBackButtonClick()" ng-attr-title="{{dc.getBackButtonToolTip()}}" tabindex="0"
                      data-fontClass="{{::dc.constants.BackImgCssClass}}" data-layercount="{{::dc.constants.BackImgCssLayers}}" id="Searchbox-back"
                      ng-keydown="dc.onBackButtonKeydown($event)"></ng-Font-icon>
        <div class="searchBoxParent" ng-class="{'showBackButton' : dc.hasSearchKeyword || dc.showObjectsView}">
            <input ng-attr-class="{{::dc.constants.SearchBoxCssClass}} newUI focusHighlight" ng-attr-id="{{::dc.constants.SearchboxId}}" type="text" ng-model="dc.searchKeyword"
                   ng-model-options="::{ allowInvalid: true }" ng-attr-maxlength="{{::dc.config.DocumentServiceQueryTextMaxLength}}" aria-label="{{dc.getSearchboxAltText()}}" aria-controls="{{::dc.constants.AnnounceAriaId}}"
                   ng-keydown="dc.onSearchBoxKeydown($event, dc.searchKeyword)" ng-trim="false" autofocus />
        </div>
        <div class="searchBoxOverlay newUI">
            <div class="searchBoxPlaceholder" ng-hide="dc.searchKeyword" ng-bind="dc.defaultSearchBoxText" tabindex="-1" ng-class="{'showBackButton' : dc.hasSearchKeyword || dc.showObjectsView}"></div>
            <ng-Font-Icon class="searchIconSearch new" ng-if="!dc.searchKeyword || dc.searchKeyword != dc.documentsService.searchKeyword" ng-click="dc.showDocuments(dc.searchKeyword)" aria-label="{{::dc.uiStrings.SearchButtonName}}" ng-attr-title="{{::dc.uiStrings.SearchButtonToolTip}}"
                          data-fontClass="{{::dc.constants.SearchImgCssClass}}" data-layercount="{{::dc.constants.SearchImgCssLayers}}" id="Searchbox-search"></ng-Font-Icon>
            <ng-Font-Icon class="searchIconCancel new" ng-if="dc.hasSearchKeyword && dc.searchKeyword && dc.searchKeyword == dc.documentsService.searchKeyword" ng-click="dc.clearSearch()" ng-attr-title="{{::dc.uiStrings.ClearSearchButtonToolTip}}" tabindex="-1"
                          data-fontClass="{{::dc.constants.CancelSearchImgCssClass}}" data-layercount="{{::dc.constants.CancelSearchImgCssLayers}}" id="Searchbox-cancel"></ng-Font-Icon>
        </div>
        <div class="topLinks">
            <span class="topLink" ng-if="dc.isBrowseSupported()" ng-bind="::dc.uiStrings.Browse"
                  ng-click="dc.showFileDialog()"
                  ng-attr-title="{{::dc.uiStrings.Browse}}" aria-label="{{::dc.uiStrings.AriaBrowse}}">
            </span>
            <span class="topLink" ng-bind="::dc.uiStrings.Feedback"
                  ng-click="dc.showSurvey()"
                  ng-attr-title="{{::dc.uiStrings.Feedback}}" aria-label="{{::dc.uiStrings.AriaFeedback}}">
            </span>
        </div>
    </div>
    <div class="{{::dc.constants.HeaderBackgroundClass}} newUI" ng-show="!dc.showObjectsView">
        <div style="display: none;" class="filterContainer" ng-class="::{'feedback': dc.isFeedbackSupported()}" id="filterContainer" ng-if="!dc.config.UI.isReuseSlideUIViewOn">
            <div ng-repeat="filter in dc.filtersToShow track by $index" class="filterButton noselect" id="{{dc.filterService.getAutomationIdFromObjectType(filter)}}" ng-class="{'selected' : dc.filterService.isFilterSelected(filter)}" ng-click="dc.setFilter(filter, $index, false)"
                 aria-label="{{dc.getFilterAiriaMessage(filter)}}" filter-id="{{$index}}" ng-focus="dc.hideFilterDropdown()"
                 ng-attr-title="{{dc.getFilterAiriaMessage(filter)}}" ng-keydown="dc.onFilterKeydown($event, $index, filter)">
                <span class="text" ng-bind="dc.filterService.getPluralNameFromObjectType(filter)"></span>
            </div>
            <div class="filterExpanderContainer" ng-if="dc.filtersInDropDown.length > 0">
                <ng-Font-Icon class="ellipsisIcon filterExpander" ng-class="{'shown' : dc.shouldShowFilterDropDown}" data-fontClass="{{::dc.constants.EllipsisImgCssClass}}" data-layercount="{{::dc.constants.EllipsisImgCssLayers}}"
                              ng-click="dc.toggleDropDown($event, false)" aria-label="{{::dc.uiStrings.MoreFiltersAria}}" filter-id="{{dc.filtersToShow.length}}"
                              id="filterExpander" ng-attr-title="{{::dc.uiStrings.MoreFiltersAria}}"
                              ng-keydown="dc.onFilterEllipsisIconKeydown($event)"></ng-Font-Icon>
                <div class="dropDown" ng-if="dc.shouldShowFilterDropDown" id="filterDropdown">
                    <div ng-repeat="filter in dc.filtersInDropDown track by $index" ng-class="{'selected' : dc.filterService.isFilterSelected(filter)}" ng-click="dc.setFilter(filter, $index + dc.filtersToShow.length, true)"
                         filter-id="{{$index + dc.filtersToShow.length + 1}}" 
                         aria-label="{{dc.getFilterAiriaMessage(filter)}}" ng-attr-title="{{dc.getFilterAiriaMessage(filter)}}" id="{{dc.filterService.getAutomationIdFromObjectType(filter)}}"
                         ng-keydown="dc.onFilterDropdownKeydown($event, $index, filter)">
                        <span class="text" ng-bind="dc.filterService.getPluralNameFromObjectType(filter)"></span>
                    </div>
                </div>
            </div>
        </div>
        <div class="groupTitles newUI" ng-if="!dc.shouldShowErrorMessage()">
            <div class="groupTitle oneLineClip" ng-bind="dc.getDocumentGroupTitle(documentGroup)" ng-repeat="documentGroup in dc.displayDocumentGroups"
                 ng-attr-title="{{dc.getDocumentGroupTitle(documentGroup)}}" ng-if="!dc.shouldShowFilterLinks()"
                 ng-class="{ 'link': dc.shouldDisplayGroupTitleAsLink(documentGroup), 'highlight': documentGroup.HighlightTitle }"
                 ng-attr-tabindex="{{dc.shouldDisplayGroupTitleAsLink(documentGroup) ? '0': '-1'}}"
                 ng-click="dc.onGroupLinkClick(documentGroup)"></div>
        </div>
    </div>
</div>
<div class="resultContainer docDiv newUI" ng-class="{'animated': !dc.selectedDocument.IsLocal, 'flyToLeftExit': !dc.selectedDocument.IsLocal}" ng-show="!dc.showObjectsView" ng-style="{ 'top' : dc.getHeaderOffset()}" aria-hidden="true">
    <div class="docGroup fadeExit animated loadingPlaceholder" ng-if="dc.shouldShowLoadingUI()">
        <div ng-repeat="i in [1, 2, 3, 4] track by $index"
             class="docCard newUI flex-item focusHighlight" tabindex="-1">
            <div class="topContainer newUI" tabindex="-1">
                <div class="documentIcon loadingGradientFlow placeHolder"></div>
                <div class="docTitle newUI oneLineClip loadingGradientFlow placeHolder">&nbsp;</div>
            </div>
            <div class="previewImageContainer loadingGradientFlow" />
            <div class="actionBar newUI">
                <span class="loadingGradientFlow actionButtonPlaceholder"></span>
                <span class="loadingGradientFlow actionButtonPlaceholder"></span>
            </div>
        </div>
    </div>
    <div class="errorMessage top" ng-if="dc.shouldShowErrorMessage()" ng-bind="dc.getErrorMessage()">
    </div>
    <div ng-repeat="documentGroup in dc.displayDocumentGroups" class="docGroup" ng-if="dc.shouldShowDocumentGroup(documentGroup)" aria-hidden="true">
        <div ng-repeat="document in documentGroup.Documents | limitTo: documentGroup.DisplayDocumentsCount track by document.Id"
             ng-attr-id="{{::document.Id}}" class="docCard newUI flex-item focusHighlight" tabindex="0" 
             ng-repeat-render="dc.renderDocumentCard(document, $index)"
             ng-class="{ 'showHoverState': dc.isDocumentCardClickable(document), 'fadeDropEntrance': $index > 4 }"
             aria-label="{{dc.getCardAriaMessage(document)}}"
             ng-focus="dc.onDocumentFocused($event)" ng-keydown="dc.onDocumentKeydown($event, document)">
            <div ng-click="dc.onDocumentClick(document)" ng-style="{'cursor': dc.isDocumentCardClickable(document) ? 'pointer' : 'default' }" tabindex="-1">
                <div class="topContainer newUI" tabindex="-1">
                    <ng-Font-Icon class="documentIcon newUI" data-fontClass="{{::document.FileType.ImgCssClass}}" data-layercount="{{::document.FileType.ImgCssLayers}}"></ng-Font-Icon>
                    <div class="docTitle newUI oneLineClip" ng-attr-title="{{::document.Title}}" ng-bind="::document.Title"></div>
                    <div class="docPath newUI oneLineClip" ng-attr-title="{{::document.Path}}" ng-bind="::document.DisplayPath"></div>
                </div>
                <div class="debugContainer" ng-if="dc.ShouldShowDebugView()">
                    <div ng-repeat="feature in document.debugFeatures">
                        <div class="docPath newUI oneLineClip" ng-attr-title="{{::feature}}" ng-bind="::feature"></div>
                    </div>
                </div>
                <div class="previewImageContainer" ng-class="{'collapsed': !dc.shouldShowPreviewBlock(document)}">
                    <div class="previewImagePlaceholder animated fadeExitFast loadingGradientFlow" ng-if="document.ShowPlaceHolderImage" />
                    <img class="previewImage"
                         ng-if="!document.IsLocal || document.ShowShreddedObjects || $index < 1 || documentGroup.Documents[$index - 1].ShowShreddedObjects"
                         ng-controller="ShreddedObjectListController as lc" ng-init="lc.init(document)"
                         ng-src="{{document.DocumentPreviewUrl | trustAsResourceUrl}}"
                         ng-load="dc.loadDocumentPreviewNewUI($event, document)" ng-show="!document.ShowPlaceHolderImage"
                         ng-error="dc.failLoadDocumentPreviewNewUI(document)"
                         crossorigin="anonymous" />
                </div>
            </div>
            <div class="actionBar newUI"
                 ng-init="options=dc.getContextMenuOptions(document)">
                <span class="{{::dc.constants.ActionButtonCssClass}}" ng-bind="::option.DisplayText" ng-repeat="option in ::options"
                      ng-attr-title="{{dc.getOptionTooltip(option,document)}}" 
                      ng-class="{'disabled' : dc.shouldDisableOption(option,document)}"
                      ng-disabled="dc.shouldDisableOption(option,document)"
                      ng-click="dc.executeAction($event, option, document)"
                      ng-attr-tabindex="{{dc.shouldDisableOption(option,document) ? '-1': '0'}}"
                      ng-keydown="dc.onActionButtonKeydown($event, option, document)">
                </span>
            </div>
        </div>
        <div class="moreDocBtn" ng-if="dc.displayDocumentGroups.length > 1" ng-class="{'disabled': !dc.shouldShowMoreButton(documentGroup)}" tabindex="0"
             ng-click="dc.showMoreDocuments(documentGroup)"
             ng-keydown="dc.onMoreDocumentKeydown($event, documentGroup)">
            <span ng-bind="dc.getMoreDocumentsButtonText(documentGroup)"></span>
        </div>
    </div>
    <div id="{{::dc.constants.AnnounceAriaId}}" role="alert"></div>
</div>

<div class="shreddDiv fullWidth newUI" ng-class="{'animated': !dc.selectedDocument.IsLocal, 'flyFromRight': !dc.selectedDocument.IsLocal}" ng-include ng-if="dc.showObjectsView" src="'ShreddedObjectsViewNewUI.html'" ng-controller="ShreddedObjectsController as sc"
     onload="sc.init(dc, dc.selectedDocument, dc.isLaunchOnPaste)" ng-style="{top: dc.getSearchBoxOffset()}"></div>

        </script>

<div class="errorDiv fullWidth">
    <div ng-bind="er.errorMsg"></div>
</div>

        <script type="text/ng-template" id="ShreddedObjectsViewNewUI.html">

<div class="filterContainer" id="filterContainer" ng-if="!sc.config.UI.isReuseSlideUIViewOn && !(sc.shreddedObjectResults.GroupingCompleted && (!sc.shreddedObjectGroups || sc.shreddedObjectGroups.size() == 0))">
    <div ng-repeat="filter in sc.filtersToShow track by $index | limitTo: sc.constants.DefaultNumFiltersToShow" class="filterButton noselect" ng-class="{'selected' : sc.filterService.isFilterSelected(filter)}"
            ng-click="sc.setFilter(filter, $index, false)" aria-label="{{sc.getFilterAiriaMessage(filter)}}" filter-id="{{$index}}"
            ng-focus="sc.hideFilterDropdown()" id="{{sc.filterService.getAutomationIdFromObjectType(filter)}}" ng-attr-title="{{sc.getFilterAiriaMessage(filter)}}"
            ng-keydown="sc.onFilterKeydown($event, $index, filter)">
        <span class="text withCount" ng-bind="sc.getObjectDisplayName(filter)"></span>
        <span class="text withCount" ng-bind="sc.getObjectCount(filter)"></span>
    </div>
    <div class="filterExpanderContainer" ng-class="{'shown' : sc.shouldShowFilterDropDown}" ng-if="sc.filtersInDropDown.length > 0">
        <ng-Font-Icon class="ellipsisIcon filterExpander" id="filterExpander" ng-class="{'shown' : sc.shouldShowFilterDropDown}" data-fontClass="{{::sc.constants.EllipsisImgCssClass}}" data-layercount="{{::sc.constants.EllipsisImgCssLayers}}"
                        ng-click="sc.toggleDropDown($event, false)" aria-label="{{::sc.uiStrings.MoreFiltersAria}}" filter-id="{{sc.filtersToShow.length}}"
                        ng-attr-title="{{::sc.uiStrings.MoreFiltersAria}}"
                        ng-keydown="sc.onFilterEllipsisIconKeydown($event)"></ng-Font-Icon>
        <div class="dropDown" ng-if="sc.shouldShowFilterDropDown" id="filterDropdown">
            <div ng-repeat="filter in sc.filtersInDropDown track by $index" ng-click="sc.setFilter(filter, $index + sc.filtersToShow.length, true)" aria-label="{{sc.getFilterAiriaMessage(filter)}}"
                    filter-id="{{$index + sc.filtersToShow.length + 1}}"
                    id="{{sc.filterService.getAutomationIdFromObjectType(filter)}}" ng-attr-title="{{sc.getFilterAiriaMessage(filter)}}"
                    ng-keydown="sc.onFilterDropdownKeydown($event, $index, filter)">
                <span class="text withCount" ng-bind="sc.getObjectDisplayName(filter)"></span>
                <span class="text withCount" ng-bind="sc.getObjectCount(filter)"></span>
            </div>
        </div>
    </div>
</div>
<div class="docTitleBreak" ng-if="sc.config.UI.isReuseSlideUIViewOn || (sc.shreddedObjectResults.GroupingCompleted && (!sc.shreddedObjectGroups || sc.shreddedObjectGroups.size() == 0))" />
<div class="docTitleContainer">
    <ng-Font-Icon class="documentIcon left" data-fontClass="{{::sc.currentDocument.FileType.ImgCssClass}}" data-layercount="{{::sc.currentDocument.FileType.ImgCssLayers}}"
                    id="documentIcon"></ng-Font-Icon>
    <div class="left">
        <div class="docTitle oneLineClip" ng-attr-title="{{::sc.currentDocument.Title}}" ng-bind="::sc.currentDocument.Title" id="documentTitle"></div>
        <a draggable="false" ng-attr-class="docFileLink {{::sc.currentDocument.FileType.CssClass}} focusHighlight"  ng-if="::sc.isInsertAllObjectsViewSupported(sc.currentDocument)" ng-after-render="sc.setFocusToDocumentTitle()"
        href="" ng-click="sc.insertAllFromDocument(sc.currentDocument)" ng-focus="sc.hideFilterDropdown()" id="insertAll">
        <span ng-attr-class="docFileType {{::sc.currentDocument.FileType.CssClass}}" ng-bind="sc.insertAllDisplayText">&nbsp;&nbsp;</span>
        </a>
        <a draggable="false" ng-attr-class="docFileLink {{::sc.currentDocument.FileType.CssClass}} focusHighlight" ng-if="::sc.isOpenDocumentSupported(sc.currentDocument)" ng-after-render="sc.setFocusToDocumentTitle()"
            href="" ng-click="sc.openDocument(sc.currentDocument)" aria-label="{{sc.openFileAriaText}}" ng-focus="sc.hideFilterDropdown()" id="documentLink"
            title="{{::sc.openFileDisplayText}}">
            <span ng-attr-class="docFileType {{::sc.currentDocument.FileType.CssClass}}" ng-bind="sc.openFileDisplayText"></span>
        </a>
    </div>
</div>
<div class="sourceFormatCheckBox left" ng-if="sc.isInsertFormattingUIEnabled()" title="{{::sc.uiStrings.UseSourceFormatting}}">
    <input ng-attr-id="{{::sc.constants.SourceFormatCheckboxId}}" type="checkbox" ng-attr-title="{{::dc.uiStrings.UseSourceFormatting}}" aria-label="{{::dc.uiStrings.AriaUseSourceFormatting}}" ng-click="sc.updateUseSourceFormatting()" ng-checked="{{::dc.config.isSourceFormattingUsed}}" title="{{::sc.uiStrings.UseSourceFormatting}}"> {{::dc.uiStrings.UseSourceFormatting}}
</div>
    <div id="shreddGroupContainer" class="fullWidth hasFilters ">
        <div class="fadeExit animated loadingPlaceholder" ng-if="sc.showLoadingUI">
            <div class="groupTitlePadding"></div>
            <div class="shreddGroup">
            <div ng-repeat="i in [1, 2, 3, 4] track by $index" class=" newUI" tabindex="-1">
                <div class="groupTitle loadingGradientFlow placeHolder">&nbsp;</div>
                <div class="shredderObjectContainer newUI slide placeHolder">
                    <div ng-attr-class=" {{::sc.constants.ShreddObjCssClass}} newUI">
                        <div class="{{::sc.constants.ShreddImgCssClass}} newUI loadingGradientFlow placeHolder" />
                    </div>
                    <div class="actionBar newUI">
                        <span class="loadingGradientFlow actionButtonPlaceholder"></span>
                    </div>
                </div>
                <div style="width:100%; clear:both;"></div>
            </div>
            </div>
        </div>
        <div ng-if="!sc.shreddedObjectResults.HasMoreToCome && sc.shreddedObjectResults.LoadCompleted && sc.shreddedObjectResults.GroupingCompleted && !(sc.shreddedObjectGroups && sc.shreddedObjectGroups.size() > 0)">
            <div class="errorMessage">
                <div ng-if="sc.shreddedObjectResults.HasError" ng-bind="sc.shreddedObjectResults.ErrorMsg"></div>
                <div ng-if="!sc.shreddedObjectResults.HasError && !sc.filterService.isAnyFilterSelected()" ng-bind="::sc.uiStrings.ShreddedNoResultsError"></div>
                <div ng-if="!sc.shreddedObjectResults.HasError && sc.filterService.isAnyFilterSelected()" ng-bind="sc.format(sc.uiStrings.NoFilteredObjectsError, sc.filterService.getSelectedFilterAsPluralName())"></div>
            </div>
        </div>
        <div ng-if="sc.shreddedObjectGroups && sc.shreddedObjectGroups.size() > 0" ng-repeat="shreddedObjectGroup in sc.shreddedObjectGroups.getOrdered() | limitTo:sc.displayGroupCount" ng-init="groupIndex = $index" class="shreddGroup newUI"
             ng-attr-id="{{::sc.constants.ShreddGroupCssClassPrefix + $index}}">
            <div class="groupTitle" ng-if="::sc.shouldShowAsGroup()" ng-bind="::sc.getGroupTitle(shreddedObjectGroup.Group)"></div>
            <div class="groupTitlePadding" ng-if="::!sc.shouldShowAsGroup()"></div>
            <div>
                <div ng-if="shreddedObjectGroup.Objects && (shreddedObjectGroup.Expanded || $index < shreddedObjectGroup.Objects.size() - shreddedObjectGroup.CollapseObjectsCount)"
                     ng-repeat="shreddedObject in shreddedObjectGroup.Objects.getOrdered() | limitTo:sc.getDisplayObjectsCount(shreddedObjectGroup)" ng-repeat-render="sc.renderShreddedObjectPreview(shreddedObject, groupIndex, $index)"
                     id="{{shreddedObject.Id}}" ng-attr-objecttype="{{shreddedObject.Type.Id}}" ng-attr-class="{{sc.getShreddObjectCssClass(shreddedObject.Type)}} {{sc.constants.ShreddObjCssClass}} newUI {{ shreddedObject.IsInsertAllowed ? 'insertableObj' : '' }} {{ shreddedObject.InsertButtonPressed ? 'buttonClick' : '' }} {{ !shreddedObject.HtmlSrc ? 'loadingGradientAnimation' : ''}}"
                     ng-click="sc.insertShreddedObject($event, shreddedObject)" ng-focus="sc.onObjectHover(shreddedObject)"
                     ng-mouseenter="sc.onObjectHover(shreddedObject)" ng-blur="sc.onObjectBlur(shreddedObject)" ng-mouseleave="sc.onObjectBlur(shreddedObject)"
                     aria-label="{{sc.getObjectAriaLabel(shreddedObject, $index, shreddedObjectGroup)}}"
                     ng-attr-tabindex="{{shreddedObject.IsInsertAllowed ? '0': '-1'}}" ng-style="{'min-height': shreddedObject.ShowPlaceHolderImage ? '100px' : 0}"

                    </div>

            </div>

                <span class="collapseCount" ng-bind="::'+' + shreddedObjectGroup.CollapseObjectsCount" ng-show="!shreddedObjectGroup.Expanded"></span>
            </div>
        </div>
    </div>
